rmal":null,"hiAbsolute":null,"lowAbsolute":null,"events":{"onValueChange":"function(form) {
  function addSelectedMultiSelectValues() {
    var multi_select = form.get('IC, Previously received oncology treatment').currentRecord.value
      .value;
    var length = multi_select == undefined ? 0 : multi_select.length;
    var selectedValuesArray = [];
    for (var i = 0; i < length; i++) {
      var name =
        multi_select[i].displayString == undefined ?
        multi_select[i].name :
        multi_select[i].displayString;
      if (name !== undefined) {
        selectedValuesArray.push(name);
      }
    }
    return selectedValuesArray;
  }

  var selectedValuesArray = addSelectedMultiSelectValues();
  if (selectedValuesArray.length > 0) {
    if (selectedValuesArray.includes('Chemotherapy')) {
      form.get('IC, Previous chemotherapy regimen').setHidden(false);
      form.get('IC, Previous chemotherapy start date').setHidden(false);
      form.get('IC, Previous chemotherapy facility name').setHidden(false);
    } else {
      form.get('IC, Previous chemotherapy regimen').hideAndClear();
      form.get('IC, Previous chemotherapy start date').hideAndClear();
      form.get('IC, Previous chemotherapy facility name').hideAndClear();
    }
    if (selectedValuesArray.includes('Radiation therapy')) {
      form.get('IC, Previous radiation therapy regimen').setHidden(false);
      form.get('IC, Previous radiation therapy facility name').setHidden(false);
      form.get('IC, Previous radiation therapy start date').setHidden(false);
    } else {
      form.get('IC, Previous radiation therapy start date').hideAndClear();
      form.get('IC, Previous radiation therapy facility name').hideAndClear();
      form.get('IC, Previous radiation therapy regimen').hideAndClear();
    }
    if (selectedValuesArray.includes('Oncosurgery')) {
      form.get('IC, Previous oncosurgery start date').setHidden(false);
      form.get('IC, Previous oncosurgery facility name').setHidden(false);
      form.get('IC, Procedure performed').setHidden(false);
    } else {
      form.get('IC, Previous oncosurgery start date').hideAndClear();
      form.get('IC, Previous oncosurgery facility name').hideAndClear();
      form.get('IC, Procedure performed').hideAndClear();
      form.get("IC, Other procedure performed").hideAndClear();
    }
    if (selectedValuesArray.includes('Other')) {
      form.get("IC, Other treatment start date").setHidden(false);
      form.get('IC, Other treatment facility name').setHidden(false);
      form.get('IC, Other treatment modality').setHidden(false);
    } else {
      form.get('IC, Other treatment modality, other').hideAndClear();
      form.get('IC, Other treatment modality').hideAndClear();
      form.get('IC, Other treatment facility name').hideAndClear();
      form.get("IC, Other treatment start date").hideAndClear();
    }
  } else {
    [
      'IC, Previous chemotherapy facility name',
      'IC, Previous chemotherapy start date',
      'IC, Previous chemotherapy regimen',
      'IC, Previous radiation therapy start date',
      'IC, Previous radiation therapy facility name',
      'IC, Previous radiation therapy regimen',
      'IC, Procedure performed',
      'IC, Previous oncosurgery facility name',
      'IC, Previous oncosurgery start date',
      "IC, Other procedure performed",
      "IC, Other treatment start date",
      'IC, Other treatment facility name',
      'IC, Other treatment modality',
      'IC, Other treatment modality, other'
    ].forEach(concept => {
      form.get(concept).hideAndClear();
    });
  }
}"}},{"type":"obsControl","label":{"translationKey":"IC,_PREVIOUS_CHEMOTHERAPY_START_DATE_5","id":"5","units":"","type":"label","value":"IC, Previous chemotherapy start date"},"properties":{"mandatory":false,"notes":false,"addMore":false,"hideLabel":false,"controlEvent":false,"location":{"column":0,"row":3}},"id":"5","concept":{"name":"IC, Previous chemotherapy start date","uuid":"42225102-4c33-11ec-bdd8-02963d06a1c6","datatype":"Date","conceptClass":"Misc","conceptHandler":null,"answers":[],"properties":{"allowDecimal":null}},"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null},{"type":"obsControl","label":{"translationKey":"IC,_PREVIOUS_CHEMOTHERAPY_FACILITY_NAME_6","id":"6","units":"","type":"label","value":"IC, Previous chemotherapy facility name"},"properties":{"mandatory":false,"notes":false,"addMore":false,"hideLabel":false,"controlEvent":false,"location":{"column":0,"row":4}},"id":"6","concept":{"name":"IC, Previous chemotherapy facility name","uuid":"4222d34e-4c33-11ec-bdd8-02963d06a1c6","datatype":"Text","conceptClass":"Misc","conceptHandler":null,"answers":[],"properties":{"allowDecimal":null}},"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null},{"type":"obsControl","label":{"translationKey":"IC,_PREVIOUS_CHEMOTHERAPY_REGIMEN_7","id":"7","units":"","type":"label","value":"IC, Previous chemotherapy regimen"},"properties":{"mandatory":false,"notes":false,"addMore":false,"hideLabel":false,"controlEvent":false,"location":{"column":0,"row":5}},"id":"7","concept":{"name":"IC, Previous chemotherapy regimen","uuid":"4222e908-4c33-11ec-bdd8-02963d06a1c6","datatype":"Text","conceptClass":"Misc","conceptHandler":null,"answers":[],"properties":{"allowDecimal":null}},"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null},{"type":"obsControl","label":{"translationKey":"IC,_PREVIOUS_RADIATION_THERAPY_START_DATE_8","id":"8","units":"","type":"label","value":"IC, Previous radiation