7.0.0.1/openmrs/ws/rest/v1/concept/df38f11a-476f-11ec-b4e6-02963d06a1c6/name/df38f327-476f-11ec-b4e6-02963d06a1c6?v=full"}],"resourceVersion":"1.9"}],"displayString":"Abnormal findings","resourceVersion":"2.0","translationKey":"ABNORMAL_FINDINGS_46"}],"properties":{"allowDecimal":null}},"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null,"events":{"onValueChange":"function(form) {
  var multi_select = form.get("IC, Clinical Diagnosis").currentRecord.value.value;
  var length = multi_select == undefined ? 0 : multi_select.length;
  var suspectedHide = true;
  var confirmedHide = true;
  var benignHide = true;
  var abnormalHide = true;
  for (var i = 0; i < length; i++) {
    var nam = multi_select[i].displayString == undefined ? multi_select[i].name : multi_select[i].displayString;
    if (nam === "Suspected malignancy") {
      suspectedHide = false;
    }
    if (nam === "Confirmed malignancy") {
      confirmedHide = false;
    }
    if (nam === "Benign") {
      benignHide = false;
    }
    if (nam === "Abnormal findings") {
      abnormalHide = false;
    }
  }
  if (suspectedHide) {
    form.get("IC, Topography of the Tumour (suspected)").hideAndClear();
  } else {
    form.get("IC, Topography of the Tumour (suspected)").setHidden(suspectedHide);
  }
  if (confirmedHide) {
    form.get("Malignancy diagnosis details").hideAndClear();
  } else {
    form.get("Malignancy diagnosis details").setHidden(confirmedHide);
    var sectionsLength = form.find(form.rootRecord, 'Malignancy diagnosis details').length;
    const toBeHiddenFromParent = [
      'IC, Clinical FIGO staging for cancer of the vulva',
      'IC, Clinical FIGO staging for cancer of the vagina',
      'IC, Clinical FIGO staging for cancer of the cervix',
      'IC, Clinical FIGO staging for cancer of the uterus',
      'IC, Clinical FIGO staging for cancer of the ovary'
    ];
    for (var i = 0; i < sectionsLength; i++) {
      toBeHiddenFromParent.forEach(concept => {
        form.get(concept, i).setHidden(true);
      });
